$(document).ready(function(){$("#slider-range").slider({range:!0,min:1E4,max:3E5,values:[1E4,3E5],slide:function(b,a){$("#min-price").val(a.values[0]);$("#max-price").val(a.values[1])}});$("#slider-range").slider({values:[$("#min-price").val(),$("#max-price").val()]});$("#min-price").keyup(function(){$("#slider-range").slider({values:[$("#min-price").val(),$("#max-price").val()]})});$("#max-price").keyup(function(){$("#slider-range").slider({values:[$("#min-price").val(),$("#max-price").val()]})})});